                "comment": "The current app version string. If specified, this must be deterministic (e.g. a commit ref rather than `Math.random()` or `Date.now().toString()`), otherwise defaults to a timestamp of the build.\n\nFor example, to use the current commit hash, you could do use `git rev-parse HEAD`:\n\n```js\n// @errors: 7031\n/// file: svelte.config.js\nimport * as child_process from 'node:child_process';\n\nexport default {\n\tkit: {\n\t\tversion: {\n\t\t\tname: child_process.execSync('git rev-parse HEAD').toString().trim()\n\t\t}\n\t}\n};\n```",
