        "children": [
          {
            "name": "fetch",
            "snippet": "fetch: typeof fetch;",
            "comment": "`fetch` is equivalent to the [native `fetch` web API](https://developer.mozilla.org/en-US/docs/Web/API/fetch), with a few additional features:\n\n- it can be used to make credentialed requests on the server, as it inherits the `cookie` and `authorization` headers for the page request\n- it can make relative requests on the server (ordinarily, `fetch` requires a URL with an origin when used in a server context)\n- internal requests (e.g. for `+server.js` routes) go directly to the handler function when running on the server, without the overhead of an HTTP call\n- during server-side rendering, the response will be captured and inlined into the rendered HTML. Note that headers will _not_ be serialized, unless explicitly included via [`filterSerializedResponseHeaders`](https://kit.svelte.dev/docs/hooks#server-hooks-handle)\n- during hydration, the response will be read from the HTML, guaranteeing consistency and preventing an additional network request\n\n> Cookies will only be passed through if the target host is the same as the SvelteKit application or a more specific subdomain of it.",
            "bullets": [],
            "children": []
          },
          {
            "name": "data",
            "snippet": "data: Data;",
            "comment": "Contains the data returned by the route's server `load` function (in `+layout.server.js` or `+page.server.js`), if any.",
            "bullets": [],
            "children": []
          },
          {
            "name": "setHeaders",
            "snippet": "setHeaders(headers: Record<string, string>): void;",
            "comment": "If you need to set headers for the response, you can do so using the this method. This is useful if you want the page to be cached, for example:\n\n```js\n// @errors: 7031\n/// file: src/routes/blog/+page.js\nexport async function load({ fetch, setHeaders }) {\n\tconst url = `https://cms.example.com/articles.json`;\n\tconst response = await fetch(url);\n\n\tsetHeaders({\n\t\tage: response.headers.get('age'),\n\t\t'cache-control': response.headers.get('cache-control')\n\t});\n\n\treturn response.json();\n}\n```\n\nSetting the same header multiple times (even in separate `load` functions) is an error — you can only set a given header once.\n\nYou cannot add a `set-cookie` header with `setHeaders` — use the [`cookies`](https://kit.svelte.dev/docs/types#public-types-cookies) API in a server-only `load` function instead.\n\n`setHeaders` has no effect when a `load` function runs in the browser.",
            "bullets": [],
            "children": []
          },
          {
            "name": "parent",
            "snippet": "parent(): Promise<ParentData>;",
            "comment": "`await parent()` returns data from parent `+layout.js` `load` functions.\nImplicitly, a missing `+layout.js` is treated as a `({ data }) => data` function, meaning that it will return and forward data from parent `+layout.server.js` files.\n\nBe careful not to introduce accidental waterfalls when using `await parent()`. If for example you only want to merge parent data into the returned output, call it _after_ fetching your other data.",
            "bullets": [],
            "children": []
          },
          {
            "name": "depends",
            "snippet": "depends(...deps: string[]): void;",
            "comment": "This function declares that the `load` function has a _dependency_ on one or more URLs or custom identifiers, which can subsequently be used with [`invalidate()`](/docs/modules#$app-navigation-invalidate) to cause `load` to rerun.\n\nMost of the time you won't need this, as `fetch` calls `depends` on your behalf — it's only necessary if you're using a custom API client that bypasses `fetch`.\n\nURLs can be absolute or relative to the page being loaded, and must be [encoded](https://developer.mozilla.org/en-US/docs/Glossary/percent-encoding).\n\nCustom identifiers have to be prefixed with one or more lowercase letters followed by a colon to conform to the [URI specification](https://www.rfc-editor.org/rfc/rfc3986.html).\n\nThe following example shows how to use `depends` to register a dependency on a custom identifier, which is `invalidate`d after a button click, making the `load` function rerun.\n\n```js\n// @errors: 7031\n/// file: src/routes/+page.js\nlet count = 0;\nexport async function load({ depends }) {\n\tdepends('increase:count');\n\n\treturn { count: count++ };\n}\n```\n\n```html\n/// file: src/routes/+page.svelte\n<script>\n\timport { invalidate } from '$app/navigation';\n\n\texport let data;\n\n\tconst increase = async () => {\n\t\tawait invalidate('increase:count');\n\t}\n</script>\n\n<p>{data.count}<p>\n<button on:click={increase}>Increase Count</button>\n```",
            "bullets": [],
            "children": []
          }
        ]
