            "name": "parent",
            "snippet": "parent(): Promise<ParentData>;",
            "comment": "`await parent()` returns data from parent `+layout.server.js` `load` functions.\n\nBe careful not to introduce accidental waterfalls when using `await parent()`. If for example you only want to merge parent data into the returned output, call it _after_ fetching your other data.",
            "bullets": [],
